// make sure user decides if they want to add name to the project or not

const Project = ({navigate}) => {
    const project = JSON.parse(window.localStorage.getItem("project")) // this is response.data
    const title = project.data.title
    const description = project.data.description
    const technologies = Object.keys(project.data.technologies).map(key => <li>{project.data.technologies[key]}</li>)
    const resources = Object.keys(project.data.resources).map(key => <li><a href={project.data.resources[key]['link']}>{project.data.resources[key]["title"]}</a> </li>)
    return (
        <div>

            <p>
                <h1>{project.data.title}</h1>

                {description}

                <h3>Technologies:</h3>
                {technologies}

                <h3>Resources:</h3>
                {resources}

                by {project.author}
            </p>
        </div>
    )
} 

export default Project
